content:
Republicans are the party of economic disaster

@POTUS was crystal clear this morning: If Republicans don’t get out of the way, our government will likely default for the first time ever

I will set up a cloture vote to move forward the House-passed bill to suspend the debt limit

@USProgressives held firm because our priorities can’t wait.

As talks continue about the scope of the #BuildBackBetter package, I want to be abundantly clear: we will not leave working families behind.

We are at the table, but we are not going to negotiate against ourselves.

It would be a crime against humanity for Ernest Johnson to be executed. 

@GovParsonMO, you have a moral and constitutional duty to block the execution before 6 PM CT tomorrow. 

Time is running out. twitter.com/thedailybeast/…

Thank you to @RepAlLawsonJr for leading this letter as a fellow member of @HouseAgGOP / @HouseAgDems. 

